int main(){
    char s[100001], t[100001];
    scanf("%s", s);
    scanf("%s", t);
    int s_len = strlen(s), t_len = strlen(t);
    node a[s_len];
    rep(i, 0, s_len){
        a[i].c = s[i] - 'a';
        a[i].id = i;
    }
    qsort(a, s_len, sizeof(node), cmpAsc);
    lld ans;
    int f = 0;
    int id = -1, target = t[0] - 'a';
    rep(i, 0, s_len){
        if(target == a[i].c){
            id = a[i].id;
            f = 1;
            break;
        }
    }
    ans = id+1;
    rep(i, 1, t_len){
        target = t[i] - 'a';
        int l, r;
        l = binarySearch_r(a, s_len, target);
        r = binarySearch_l(a, s_len, target);
        if(l == -1 || r == -1){
            f = 0;
            break;
        }
        int buf = binarySearch_id(a, l, r, id);
        if(a[buf].id <= id){
            buf = l;
        }
        if(id < a[buf].id){
            ans += a[buf].id - id;
        }else{
            ans += s_len + a[buf].id - id;
        }
        id = a[buf].id;
    }
    if(f){
        printf("%lld", ans);
    }else{
        printf("-1");
    }

    return 0;
}
